function InfoBlock(props){
    let data = props.data
    return(
        <div className="InfoBlock" style={backgroundColor = data.mainColor}>
            <p className="InfoValue">{data.value}</p>
            <p className="InfoTitle">{data.title}</p>
        </div>
    )
}

